<p>Now, models Natalie Roser, Georgia Gibbs, Shannon Lawson, Laura Dundovic and Cassie Cameron have all headed to Byron on holiday.</p>

<p>The Zac Efron effect? Instagram models are flocking to NSW celebrity enclave Byron Bay as the Queensland border is currently closed. Pictured (L-R): Laura Dundovic, Cassie Cameron and Shannon Lawson</p>

<p>'Girls trip to Byron tomorrow. Any recommendations on where I can spot Zac Efron, find a nice coffee/cocktail bar or even suggest a few secret beaches?' Shannon wrote on Instagram.</p>

<p>Meanwhile, Laura posted a photo of herself with Natalie and Georgia, which she captioned: 'BYRON BAECATION OFF TO A MAGIC START.'</p>

<p>The ladies have been documenting their trip on Instagram with endless pictures of themselves in bikinis, activewear and summer dresses.</p>

<p>Natalie posted a picture of herself in a tie-dye dress, and said in the caption that she loves Byron for its warm weather, pristine beaches, food and coffee.</p>

